sys_variable_value.value:
(function execute(inputs, outputs) {

var grStep = inputs.grStep;
var idParent = inputs.idParent;
var strEncodedQuery = grStep.template.template + '';

var strTable = grStep.getValue('table');
var strFieldParent = grStep.getValue('parent_field');

var grTask = new GlideRecord(strTable);
grTask.initialize();
grTask.setValue(strFieldParent, idParent);
grTask.applyEncodedQuery(strEncodedQuery);
var idTarget = grTask.insert();


outputs.task = grTask;
    
})(inputs, outputs);

